// Write your code here
import './index.css'

const Body = props => {
  const {TaskDetails} = props
  const {dueOn, status, title, UserId} = TaskDetails
  return (
    <>
      <td>{title}</td>
      <td>{dueOn}</td>
      <td>{status}</td>
      <td>{UserId}</td>
    </>
  )
}
export default Body
